import React from "react";

export default function RecipeCard(props) {
  console.log(props);
  const diets = props.Diets.map((diet) => diet.name);
  return (
    <div>
      <img src={props.recipe.image} alt="recipe" />
      <div>
        <p>{props.recipe.id} </p>
        <p>
          <strong>Name:</strong> {props.recipe.name}
        </p>
        <h3>Diets</h3>
        {diets.map((d) => (
          <li key={props.id}> {d}</li>
        ))}
      </div>
    </div>
  );
}
